def listToMatrix(lst, rows, cols):  # 24, 25
    z_matrix = np.zeros((rows, cols))
    for i in range(0, rows):
        z_matrix[i] = lst[i*cols:(i+1)*cols]
        print(z_matrix[i])
    return z_matrix

